NetworkContextClientAsyncWaiter::NetworkContextClientAsyncWaiter(NetworkContextClient* proxy)
    : proxy_(proxy)
{
}

NetworkContextClientAsyncWaiter::~NetworkContextClientAsyncWaiter() = default;

void NetworkContextClientAsyncWaiter::OnFileUploadRequested(int32_t process_id, bool async, const std::vector<::base::FilePath>& file_paths,
    const ::GURL& destination_url, int32_t* out_net_error, std::vector<::base::File>* out_files)
{
    base::RunLoop loop;
    proxy_->OnFileUploadRequested(std::move(process_id), std::move(async), std::move(file_paths), std::move(destination_url),
        base::BindOnce(
            [](base::RunLoop* loop, int32_t* out_net_error, std::vector<::base::File>* out_files, int32_t net_error, std::vector<::base::File> files) {
                *out_net_error = std::move(net_error);
                *out_files = std::move(files);
                loop->Quit();
            },
            &loop, out_net_error, out_files));
    loop.Run();
}

void NetworkContextClientAsyncWaiter::OnCanSendReportingReports(const std::vector<::url::Origin>& origins, std::vector<::url::Origin>* out_origins)
{
    base::RunLoop loop;
    proxy_->OnCanSendReportingReports(std::move(origins),
        base::BindOnce(
            [](base::RunLoop* loop, std::vector<::url::Origin>* out_origins, const std::vector<::url::Origin>& origins) {
                *out_origins = std::move(origins);
                loop->Quit();
            },
            &loop, out_origins));
    loop.Run();
}

std::vector<::url::Origin> NetworkContextClientAsyncWaiter::OnCanSendReportingReports(const std::vector<::url::Origin>& origins)
{
    std::vector<::url::Origin> async_wait_result;
    OnCanSendReportingReports(std::move(origins), &async_wait_result);
    return async_wait_result;
}

void NetworkContextClientAsyncWaiter::OnCanSendDomainReliabilityUpload(const ::url::Origin& origin, bool* out_allowed)
{
    base::RunLoop loop;
    proxy_->OnCanSendDomainReliabilityUpload(std::move(origin),
        base::BindOnce(
            [](base::RunLoop* loop, bool* out_allowed, bool allowed) {
                *out_allowed = std::move(allowed);
                loop->Quit();
            },
            &loop, out_allowed));
    loop.Run();
}

bool NetworkContextClientAsyncWaiter::OnCanSendDomainReliabilityUpload(const ::url::Origin& origin)
{
    bool async_wait_result;
    OnCanSendDomainReliabilityUpload(std::move(origin), &async_wait_result);
    return async_wait_result;
}

void NetworkContextClientAsyncWaiter::OnCanSendSCTAuditingReport(bool* out_allowed)
{
    base::RunLoop loop;
    proxy_->OnCanSendSCTAuditingReport(base::BindOnce(
        [](base::RunLoop* loop, bool* out_allowed, bool allowed) {
            *out_allowed = std::move(allowed);
            loop->Quit();
        },
        &loop, out_allowed));
    loop.Run();
}

bool NetworkContextClientAsyncWaiter::OnCanSendSCTAuditingReport()
{
    bool async_wait_result;
    OnCanSendSCTAuditingReport(&async_wait_result);
    return async_wait_result;
}

